import React from 'react';
import {Col, Container, Image, Row} from "react-bootstrap";
import '../style/DevicePage.css'

const DevicePage = () => {
    const device =
        {id: 1, name:'Традиции Тайланда: общий', price: '3000', img: 'f7abf590-a78c-4ba5-a652-61ba64735e86.jpg'}

    const description =
        {id:1, title: 'Офывфыздвзфдывзфы зыфдвз фыдзвдыфз дзывд зыдвзфыдвздыз дзв дыфзвдзь', timeLaps: '123'}

    return (
        <div className={'wrapper'}>
            <div className={"devicePage"}>
                <Image width={300} height={300} src={device.img}/>
                <div className={'devicePage__description'}>
                    <h2>{device.name}</h2>
                    <h3>{device.price} руб.</h3>
                    <h3>{description.timeLaps}ч.</h3>
                    <p>{description.title}</p>
                    <button className={'link'}>Добавить в корзину</button>
                </div>
            </div>
        </div>

        // <Container className={'d-flex'}>
        //     <Col>
        //         <Image width={300} height={300} src={device.img}/>
        //     </Col>
        //     <div>
        //         <h2 className={'align-items-start'}>{device.name}</h2>
        //     </div>
        // </Container>
    );
};

export default DevicePage;
